import React from 'react';
import { Fragment } from 'react';

function DataImportation() {
    return (
      <div className='DataImportation'>
       <Fragment>
         <div class='container'>
            <button id="relation">Gerar Relat√≥rio</button>
         </div>

         <div id='result'></div>
       </Fragment>
      </div>
    );
  }
  document.getElementById('relation').addEventListener('click', loadTxt);

  function loadTxt(){
    fetch('AFD.txt')
    .then(function(response) {
      console.log(response.text())
    })
    .then(function(AFD){
      console.log(AFD);
      document.getElementById('result').innerHTML = AFD;
    })
  }

  export default DataImportation;
